CREATE TABLE rol (
  id int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  nombre varchar(100) NOT NULL DEFAULT '',
  estado_id int(11) NOT NULL DEFAULT 3,
  PRIMARY KEY (id)
