--
-- Create procedure `ST_LIST_ROLES`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE ST_LIST_ROLES ()
COMMENT 'Lista los roles del sistema'
BEGIN

  SELECT
    r.id,
    r.nombre
  FROM rol r
  WHERE r.estado_id = 3;

END
$$

