DELIMITER $$

--
-- Create function `FU_UP_USR`
--
CREATE DEFINER = 'root'@'localhost'
FUNCTION FU_UP_USR (`v_usuario` varchar(45),
`v_grupo` varchar(45),
`v_familia` varchar(3),
`v_mail` varchar(90),
`v_estado` varchar(45),
`v_id` int)
RETURNS longtext CHARSET utf8mb4
DETERMINISTIC
MODIFIES SQL DATA
BEGIN
  DECLARE devolucion longtext;
  UPDATE soliris_usuarios
  SET usuario = v_usuario,
      grupo = v_grupo,
