--
-- Create function `FU_NEW_USR`
--
CREATE DEFINER = 'root'@'localhost'
FUNCTION FU_NEW_USR (`v_usuario` varchar(45),
`v_grupo` varchar(45),
`v_familia` varchar(3),
`v_mail` varchar(90))
RETURNS longtext CHARSET utf8mb4
DETERMINISTIC
MODIFIES SQL DATA
BEGIN
  DECLARE id_1 int;
  DECLARE id_2 int;

  DECLARE devolucion longtext;

  SET id_1 = (SELECT
      LAST_INSERT_ID());

  grupo,
  familia,
  mail,
  estado)
    SELECT
      v_usuario,
      v_grupo,
      v_familia,
      v_mail,
      'Activo'
    FROM dual
    WHERE NOT EXISTS (SELECT
        *
      FROM soliris_usuarios
      WHERE usuario = v_usuario
      AND grupo = v_grupo
      AND familia = v_familia
      AND mail = v_mail);

  SET id_2 = (SELECT
      LAST_INSERT_ID());

  IF (id_1 <> id_2) THEN
    RETURN id_2;
  END IF;

  RETURN 'ERROR NO_INSERT';
END
$$

