--
-- Create procedure `ST_UserAccess`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE ST_UserAccess (IN `v_usuario` varchar(50))
COMMENT 'valida el estado y la existencia del usuario en el sistema. Devuelve las propiedades de grupo y la familia'
BEGIN

  DECLARE res int;

  SET res = (SELECT
      COUNT(*)
    FROM usuario
    WHERE username = v_usuario
    AND estado_id = (SELECT
        id
      FROM maestro_estado
      WHERE tipo = 'Estado'
      AND referencia = 'usuario'
      AND valor = 'Activo'));

  IF (res > 0) THEN
    SELECT
      u.id,
      u.username,
      r.nombre AS 'grupo'
    FROM usuario u
      INNER JOIN rol r
        ON u.rol_id = r.id
    WHERE username = v_usuario;
  ELSE
    -- Trabajar con la tabla de mensajes
    SELECT
      "Mensaje de error";

  END IF;

END
$$

--
-- Create procedure `ST_UP_USUARIO`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE ST_UP_USUARIO (IN `p_id` int(10),
IN `p_username` varchar(45),
IN `p_email` varchar(255),
IN `p_estado` varchar(50),
IN `p_rol_id` int(11))
BEGIN
  START TRANSACTION;

    SET @estado = (SELECT
        id
      FROM maestro_estado m
      WHERE m.referencia = 'Usuario'
      AND m.valor = p_estado);
    SET @countUsuario = (SELECT
        COUNT(*)
      FROM usuario u
      WHERE u.username = p_username);
    /** Verifico que el usuario se encuentre en la base **/
    IF (@countUsuario = 1) THEN

      UPDATE usuario
      SET username = p_username,
          email = p_email,
          estado_id = @estado,
          rol_id = p_rol_id
      WHERE id = p_id;

      SELECT
        "Se actualizó el usuario correctamente" AS mensaje;

    ELSE

      SELECT
        "No se encontró el usuario en la base" AS mensaje;

    END IF;

  COMMIT;
END
$$

