CREATE DEFINER = 'root'@'localhost'
PROCEDURE ST_DISABLE_OLD_DOC_PAC (IN `v_idPac` int,
IN `v_idTipoDoc` int)
COMMENT 'Coloca el estado inactivo a los documentos de un paciente'
