CREATE DEFINER = 'root'@'localhost'
FUNCTION FU_GET_PACIENTE_EDAD (`v_id_paciente` int)
RETURNS int(11)
COMMENT 'DEVUELVE LA EDAD DEL PACIENTE'
BEGIN

  RETURN (SELECT
      YEAR(CURDATE()) - YEAR(p.fecha_nac) - IF(STR_TO_DATE(CONCAT(YEAR(CURDATE()), '-', MONTH(p.fecha_nac), '-', DAY(p.fecha_nac)), '%Y-%c-%e') > CURDATE(), 1, 0) AS edad
    FROM paciente p
    WHERE p.id = v_id_paciente);


END
$$

--
-- Create procedure `ST_UP_PACIENTE`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE ST_UP_PACIENTE (IN `v_id` int,
IN `v_apellido` varchar(100),
IN `v_nombre` varchar(100),
IN `v_fecha_nac` date,
IN `v_sexo` varchar(2),
IN `v_telefono` varchar(45),
IN `v_ciudad` varchar(100),
IN `v_pais_id` int,
IN `v_mail` varchar(100),
IN `v_patologia_id` int,
IN `v_sub_patologia_id` int,
IN `v_os_id` int,
IN `v_usuario` varchar(50),
IN `v_sub_estado_id` varchar(50),
IN `v_estado_id` int,
IN `v_crm_id` int,
IN `v_notas` varchar(50))
COMMENT 'Actualizacion de paciente'
BEGIN

  DECLARE c_usuario_mod_id int;

  DECLARE EXIT HANDLER FOR SQLWARNING
  BEGIN
    SELECT
      'ERROR: HA OCURRIDO UN ERROR AL ACTUALIZAR EL PACIENTE' AS mensaje;
  END;

  SET c_usuario_mod_id = (SELECT
      u.id
    FROM usuario u
    WHERE v_usuario = u.username);

  -- Cada actualización del paciente debe volver a un estado Pendiente para que sea aprobado por FV
  SET @estado_id_pendiente = (SELECT
      id
    FROM maestro_estado m
    WHERE m.referencia = 'paciente'
    AND m.valor = 'Pendiente');





  UPDATE paciente
  SET apellido = v_apellido,
      nombre = v_nombre,
      nombre_completo = CONCAT(v_apellido, ', ', v_nombre),
      fecha_nac = v_fecha_nac,
      sexo = v_sexo,
      telefono = v_telefono,
      ciudad = v_ciudad,
      pais_id = v_pais_id,
      mail = v_mail,
      patologia_id = v_patologia_id,
      sub_patologia_id = v_sub_patologia_id,
      os_id = v_os_id,
      c_gestar = '',
      estado_id = @estado_id_pendiente,
      sub_estado_id = v_sub_estado_id,
      familia = 'SOL',
      fecha_modificacion = NOW(),
      usuario_mod_id = c_usuario_mod_id,
      crm_id = v_crm_id,
      notas = v_notas
  WHERE id = v_id;

  SELECT
    'ACTUALIZACION CORRECTA' AS mensaje;

END
$$

--
-- Create procedure `ST_NEW_PACIENTE`
--
CREATE DEFINER = 'admin'@'%'
PROCEDURE ST_NEW_PACIENTE (IN `v_apellido` varchar(100),
IN `v_nombre` varchar(100),
IN `v_fecha_nac` date,
IN `v_sexo` varchar(2),
IN `v_telefono` varchar(45),
IN `v_ciudad` varchar(100),
IN `v_pais_id` int,
IN `v_mail` varchar(100),
IN `v_patologia_id` int,
IN `v_sub_patologia_id` int,
IN `v_os_id` int,
IN `v_usuario` varchar(50),
IN `v_sub_estado_id` int,
IN `v_crm_id` int)
COMMENT 'Creacion del nuevo paciente'
BEGIN

  DECLARE c_usuario_id int;
  DECLARE c_sub_estado int;

  -- devolvemos el error que ya existe un paciente con la combinacion de apellido, nombre y fecha de nacimiento
  DECLARE EXIT HANDLER FOR 1062
  BEGIN
    SELECT
      CONCAT('ERROR: Ya existe el paciente ', CONCAT(v_apellido, ', ', v_nombre), ' con fecha de nacimiento: ', v_fecha_nac) AS mensaje;
  END;

  -- SE ESTABLECE QUE EL PRIMER ESTADO QUE TOMA EL PACIENTE ES "SIN DOCUMENTACION" HASTA TANTO NO SE CARGUE LA DOCUMENTACION

  SET @estado_id = (SELECT
      id
    FROM maestro_estado m
    WHERE m.referencia = 'paciente'
    AND m.valor = 'Sin Documentacion');


  -- SET c_sub_estado = (SELECT id FROM `maestro_estado` WHERE `tipo` = 'sub_estado' AND valor = 'v_sub_estado');

  SET c_usuario_id = (SELECT
      u.id
    FROM usuario u
    WHERE v_usuario = u.username);

  nombre,
  nombre_completo,
  fecha_nac,
  sexo,
  telefono,
  ciudad,
  pais_id,
  mail,
  patologia_id,
  sub_patologia_id,
  os_id,
  usuario_id,
  usuario_mod_id,
  estado_id,
  sub_estado_id,
  fecha_creacion,
  fecha_modificacion,
  familia,
  crm_id)
    VALUES (v_apellido, v_nombre, CONCAT(v_apellido, ', ', nombre), v_fecha_nac, v_sexo, v_telefono, v_ciudad, v_pais_id, v_mail, v_patologia_id, v_sub_patologia_id, v_os_id, c_usuario_id, c_usuario_id, @estado_id, v_sub_estado_id, NOW(), NOW(), 'SOL', v_crm_id);

  SELECT
    LAST_INSERT_ID() AS mensaje;


END
$$

--
-- Create procedure `ST_MAIL_PACIENTE`
--
CREATE DEFINER = 'admin'@'%'
PROCEDURE ST_MAIL_PACIENTE (IN `v_idPaciente` int,
IN `v_accion` varchar(50))
COMMENT 'Devolucion de datos para el mail de paciente'
BEGIN

  -- OBTENGO LOS EMAILS PARA LA ACCION Y VERIFICO QUE LA NOTIFICACION ESTE ACTIVADA

  SET @emails := (SELECT
      GROUP_CONCAT(CONCAT(u.username, '-', u.email)) AS us
    FROM rel_mail_rol rel
      INNER JOIN mail_configuracion mc
        ON rel.mail_configuracion_id = mc.id
      INNER JOIN rol r
        ON r.id = rel.rol_id
      INNER JOIN usuario u
        ON u.rol_id = r.id
    WHERE mc.descripcion = v_accion
    AND mc.estado_id = 1);

  -- OBTENGO EL ID DE LA ACCIÓN
  SET @idMailConfig = (SELECT
      mc.id
    FROM mail_configuracion mc
    WHERE mc.descripcion = v_accion);

  -- OBTENGO EL NOMBRE DEL PACIENTE
  SET @nom_pac := (SELECT
      CONCAT(p.apellido, ', ', p.nombre)
    FROM paciente p
    WHERE p.id = v_idPaciente);

  -- SI ES UN ALTA DE PACIENTE RETORNO SOLO EL NOMBRE Y EL USUARIO QUE CREÓ EL REGISTRO
  IF (@idMailConfig = 7) THEN
    SET @usuario := (SELECT
        FU_GET_USERNAME_USUARIO(p.usuario_id)
      FROM paciente p
      WHERE p.id = v_idPaciente);
    SET @notas := (SELECT
        p.notas
      FROM paciente p
      WHERE p.id = v_idPaciente);
    SELECT
      @emails AS emails,
      @nom_pac AS nom_pac,
      @usuario AS usuario,
      @notas AS notas;
  ELSE
    -- SI ES UNA MODIFICACIÓN O BAJA RETORNO EL USUARIO QUE HIZO LA MODIFICACIÓN Y LAS NOTAS
    IF (@idMailConfig = 2
      OR @idMailConfig = 8
      OR @idMailConfig = 9) THEN
      SET @usuario := (SELECT
          FU_GET_USERNAME_USUARIO(p.usuario_mod_id)
        FROM paciente p
        WHERE p.id = v_idPaciente);
      SET @estado := (SELECT
          m.valor
        FROM maestro_estado m
          INNER JOIN paciente p
            ON p.estado_id = m.id
        WHERE m.referencia = 'paciente'
        AND p.id = v_idPaciente);
      SET @notas := (SELECT
          p.notas
        FROM paciente p
        WHERE p.id = v_idPaciente);
      SELECT
        @emails AS emails,
        @nom_pac AS nom_pac,
        @usuario AS usuario,
        @notas AS notas,
        @estado AS estado;
    END IF;
  END IF;



END
$$

