--
-- Create function `FU_UP_ESP`
--
CREATE DEFINER = 'root'@'localhost'
FUNCTION FU_UP_ESP (`v_nombre` varchar(100),
`v_familia` varchar(3),
`v_estado` varchar(45),
`v_usuario` varchar(45),
`v_id` int)
RETURNS longtext CHARSET utf8mb4
DETERMINISTIC
MODIFIES SQL DATA
BEGIN
  DECLARE devolucion longtext;
  UPDATE especialidad e
  SET e.especialidad = v_nombre,
      e.familia = v_familia,
      e.estado_id = (SELECT
          m.id
        FROM maestro_estado m
        WHERE m.valor = v_estado
        AND m.referencia = 'especialidad'),
      usuario_audit = v_usuario
  WHERE id = v_id;

  IF (SELECT
        ROW_COUNT() > 0) THEN
    SET devolucion = v_id;
  ELSE
    SET devolucion = 'ERROR NO_UPDATE';
  END IF;

  RETURN devolucion;

END
$$

--
-- Create function `FU_NEW_ESP`
--
CREATE DEFINER = 'root'@'localhost'
FUNCTION FU_NEW_ESP (`v_nombre` varchar(100),
`v_familia` varchar(3),
`v_usuario` varchar(45))
RETURNS longtext CHARSET utf8mb4
DETERMINISTIC
MODIFIES SQL DATA
BEGIN
  DECLARE id_1 int;
  DECLARE id_2 int;

  DECLARE devolucion longtext;

  SET id_1 = (SELECT
      LAST_INSERT_ID());

  familia,
  estado_id,
  usuario_audit)
    SELECT
      v_nombre,
      v_familia,
      28,
      v_usuario
    FROM dual
    WHERE NOT EXISTS (SELECT
        *
      FROM especialidad
      WHERE especialidad = v_nombre
      AND familia = v_familia
      AND usuario_audit = v_usuario);

  SET id_2 = (SELECT
      LAST_INSERT_ID());

  IF (id_1 <> id_2) THEN
    RETURN id_2;
  END IF;

  RETURN 'ERROR NO_INSERT';
END
$$

