--
-- Create procedure `ST_SET_SEGURIDAD`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE ST_SET_SEGURIDAD (IN `v_idPagina` int,
IN `v_grupo` varchar(50),
IN `v_estado` int,
IN `v_usuario` varchar(50))
COMMENT 'Establece el permiso en una pagina'
BEGIN

  -- Consulta del id del rol
  SET @rol_id := (SELECT
      r.id
    FROM rol r
    WHERE r.nombre = v_grupo);

  -- Consulta del id del usuario que esta haciendo la accion
  SET @usuario_id := (SELECT
      FU_GET_ID_USUARIO(v_usuario));

  -- Establezo el id del estado para la tabla de relacion
  IF (v_estado = 1) THEN
    SET @estado_id := (SELECT
        m.id
      FROM maestro_estado m
      WHERE m.referencia = 'rel_seguridad_rol'
      AND m.valor = 'Activo');
  ELSE
    SET @estado_id := (SELECT
        m.id
      FROM maestro_estado m
      WHERE m.referencia = 'rel_seguridad_rol'
      AND m.valor = 'Inactivo');
  END IF;

  -- Cuento si ya existe la relacion entre grupo y la pagina

  SET @COUNT := (SELECT
      COUNT(*)
    FROM rel_seguridad_rol rel
    WHERE rel.seguridad_id = v_idPagina
    AND rel.rol_id = @rol_id);


  IF (@COUNT > 0) THEN
    -- Actualizo el estado del rol en esa pagina	
    UPDATE rel_seguridad_rol rel
    SET rel.seguridad_id = v_idPagina,
        rel.rol_id = @rol_id,
        rel.estado_id = @estado_id
    WHERE rel.rol_id = @rol_id;
  ELSE
    -- Inserto el registro en la base
      VALUES (v_idPagina, @rol_id, @estado_id, @usuario_id, NOW());

  END IF;





END
$$

--
-- Create procedure `ST_LIST_SEGURIDAD`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE ST_LIST_SEGURIDAD ()
COMMENT 'LISTA LAS PAGINAS Y SU RELACION CON LOS ROLES'
BEGIN

  SELECT
    s.id,
    s.pagina,
    s.descripcion,
    GROUP_CONCAT(r.nombre SEPARATOR ',') roles,
    GROUP_CONCAT(r.id SEPARATOR ',') roles_id
  FROM soliris_seguridad s
    LEFT JOIN rel_seguridad_rol rel
      ON s.id = rel.seguridad_id
    LEFT JOIN rol r
      ON rel.rol_id = r.id
  -- WHERE rel.estado_id = 32 -- Verifico que este activa la relacion con la pagina
  GROUP BY s.id,
           s.pagina;

END
$$

--
-- Create procedure `ST_GET_ACCESS`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE ST_GET_ACCESS (IN `v_pagina` varchar(50),
IN `v_grupo` varchar(50))
COMMENT 'Detecta si el rol del usuario tiene permisos a la pagina solicitada'
BEGIN

  DECLARE pagina_id int;
  DECLARE grupo_id int;


  SET pagina_id = (SELECT
      id
    FROM soliris_seguridad s
    WHERE s.pagina = v_pagina);
  SET grupo_id = (SELECT
      id
    FROM rol r
    WHERE r.nombre = v_grupo);

  SELECT
    COUNT(*)
  FROM rel_seguridad_rol rsr
  WHERE rsr.seguridad_id = pagina_id
  AND rsr.rol_id = grupo_id;


END
$$

