CREATE DEFINER = 'root'@'localhost'
PROCEDURE ST_SHOW_PACIENTE (IN `v_id` int)
COMMENT 'Muestra la informacion del paciente'
BEGIN



  SELECT
    p.id AS id,
    p.apellido AS apellido,
    p.nombre AS nombre,
    p.nombre_completo,
    p.usuario_id AS usuario_creador_id,
