--
-- Create table `soliris_documentacion`
--
CREATE TABLE soliris_documentacion (
  id int(10) UNSIGNED NOT NULL AUTO_INCREMENT,
  maestro_id int(10) UNSIGNED NOT NULL DEFAULT 0,
