--
-- Create trigger `log_usuario_del`
--
CREATE
DEFINER = 'admin'@'%'
TRIGGER log_usuario_del
AFTER DELETE
ON usuario
FOR EACH ROW
BEGIN
  SET usuario = USER(),
      fecha = NOW(),
      accion = 'delete',
      registro = 'id',
      tabla = 'usuario',
      id_registro = old.id,
      valor_anterior = old.id;
  SET usuario = USER(),
      fecha = NOW(),
      accion = 'delete',
      registro = 'username',
      tabla = 'usuario',
      id_registro = old.id,
      valor_anterior = old.username;
  SET usuario = USER(),
      fecha = NOW(),
      accion = 'delete',
      registro = 'email',
      tabla = 'usuario',
      id_registro = old.id,
      valor_anterior = old.email;
  SET usuario = USER(),
      fecha = NOW(),
      accion = 'delete',
      registro = 'estado_id',
      tabla = 'usuario',
      id_registro = old.id,
      valor_anterior = old.estado_id;
  SET usuario = USER(),
      fecha = NOW(),
      accion = 'delete',
      registro = 'rol_id',
      tabla = 'usuario',
      id_registro = old.id,
      valor_anterior = old.rol_id;
END
$$

