CREATE
DEFINER = 'admin'@'%'
TRIGGER log_usuario_upd
BEFORE UPDATE
ON usuario
FOR EACH ROW
BEGIN
  IF old.id <> new.id THEN
    SET usuario = USER(),
        fecha = NOW(),
        accion = 'update',
        registro = 'id',
        tabla = 'usuario',
        id_registro = old.id,
        valor_anterior = OLD.id,
        valor_nuevo = NEW.id;
  END IF;
  IF old.username <> new.username THEN
    SET usuario = USER(),
        fecha = NOW(),
        accion = 'update',
        registro = 'username',
        tabla = 'usuario',
        id_registro = old.id,
        valor_anterior = OLD.username,
        valor_nuevo = NEW.username;
  END IF;
  IF old.email <> new.email THEN
    SET usuario = USER(),
        fecha = NOW(),
        accion = 'update',
        registro = 'email',
        tabla = 'usuario',
        id_registro = old.id,
        valor_anterior = OLD.email,
        valor_nuevo = NEW.email;
  END IF;
  IF old.estado_id <> new.estado_id THEN
    SET usuario = USER(),
        fecha = NOW(),
        accion = 'update',
        registro = 'estado_id',
        tabla = 'usuario',
        id_registro = old.id,
        valor_anterior = OLD.estado_id,
        valor_nuevo = NEW.estado_id;
  END IF;
  IF old.rol_id <> new.rol_id THEN
    SET usuario = USER(),
        fecha = NOW(),
        accion = 'update',
        registro = 'rol_id',
        tabla = 'usuario',
        id_registro = old.id,
        valor_anterior = OLD.rol_id,
        valor_nuevo = NEW.rol_id;
  END IF;
END
$$

